import React from 'react';

const DatasetItem = ({ dataset }) => {
  return (
    <View>
      <Card>
        <View>
          <Text>{dataset.id}</Text>
          <Text>{dataset.product_id}</Text>
          <Text>Likes Grouped:</Text>
          <View>
            <Text>{dataset.data.LikesGrouped.Sum.ZeroLikes}</Text>
            <Text>{dataset.data.LikesGrouped.Sum.NonZeroLikes}</Text>
            <Text>{dataset.data.LikesGrouped.Count.ZeroLikes}</Text>
            <Text>{dataset.data.LikesGrouped.Count.NonZeroLikes}</Text>
          </View>
          <Text>Average Rating: {dataset.data.average_rating}</Text>
          <Text>Max Likes in the Dataset: {dataset.data.MaxLikesInTheDataset}</Text>
          <Text>Total Number of Likes in the Dataset: {dataset.data.TotalNumberOfLikesInTheDataset}</Text>
        </View>
      </Card>
    </View>
  );
};

export default DatasetItem;
